import { BrowserRouter, Route } from 'react-router-dom';
import SignIn from "../views/SignIn";

function GlobalRouter() {
    return (
        <BrowserRouter>
            <Route path="/" element={<SignIn />}/>
        </BrowserRouter>
    );
}

export default GlobalRouter;
